function() {
  // Get the values of the check-in and checkout dates from the dataLayer
  var checkinDate = {{campspot - checkinDateInParkTimeZone}};   // Replace with the variable name for the check-in date
  var checkoutDate = {{campspot - checkoutDateInParkTimeZone}}; // Replace with the variable name for the checkout date

  // Convert the check-in and checkout dates to JavaScript Date objects
  var checkin = new Date(checkinDate);
  var checkout = new Date(checkoutDate);

  // Calculate the time difference in milliseconds between the checkout and check-in dates
  var timeDifference = checkout - checkin;

  // Calculate the number of days between the checkout and check-in dates
  var daysDifference = Math.floor(timeDifference / (1000 * 60 * 60 * 24));

  return daysDifference;
}

